import React, { useEffect, useState } from "react";
import { Link } from "react-router-dom";

function ListUrheilijat() {
  const [urheilijaData, setUrheilijadata] = useState([]);
  useEffect(() => {
    const getUrheilijadata = async () => {
      const reqData = await fetch("http://localhost:3000/urheilijat/")
        .then((response) => {
          return response.json();
        })
        .then((reqData) => {
          setUrheilijadata(reqData);
        });

      console.log(reqData);
    };
  }, []);

  return (
    <React.Fragment>
      <div className="container">
        <div className="row">
          <div className="col-md-12">
            <h5 className="mt-2">Urheilijoiden tiedot</h5>
            <div className="d-grid d-md-flex justify-content-md-end mb-3">
              <Link to="/adduser" className="btn btn-warning">
                Lisää urheilija
              </Link>
            </div>
            <table className="table table-bordered table-striped">
              <thead>
                <tr>
                  <th>id</th>
                  <th>Etunimi</th>
                  <th>Sukunimi</th>
                  <th>Paino</th>
                  <th>Laji</th>
                  <th>Syntymävuosi</th>
                  <th>Saavutukset</th>
                </tr>
              </thead>
              <tbody>
                {urheilijaData.map((urheilijaData, index) => (
                  <tr key={index}>
                    <td>{urheilijaData.id} </td>
                    <td>{urheilijaData.etunimi} </td>
                    <td>{urheilijaData.sukunimi} </td>
                    <td>{urheilijaData.paino} </td>
                    <td>{urheilijaData.syntymavuosi} </td>
                    <td>{urheilijaData.saavutukset} </td>
                    <td>
                      <Link
                        to={"/editUrheilija/" + urheilijaData.id}
                        className="btn btn-success mx-2"
                      >
                        Edit
                      </Link>
                      <Link to="/deleteUser" className="btn btn-danger">
                        Delete
                      </Link>
                    </td>
                  </tr>
                ))}
              </tbody>
            </table>
          </div>
        </div>
      </div>
    </React.Fragment>
  );
}

export default ListUrheilijat;
